INSERT INTO `myaac_news` VALUES (5,'Bem vindo ao Middle Earth Server!','<p style=\"text-align: center;\">Boas vindas ao Middle Earth Server!</p>\r\n<p style=\"text-align: center;\">Para jogar em nosso servidor, voc&ecirc; precisar&aacute; do client disponivel na aba de downloads.<br /><img src=\"https://www.tibiawiki.com.br/images/thumb/7/76/Tibia_icon.png/120px-Tibia_icon.png?20190711200111\" alt=\"Client Icon\" /><br /><a href=\"../?download_client\">Download do Client </a><br /><br />Abaixo deixarei listados alguns dos principais sistemas do servidor, sendo eles:<br /><br /><img src=\"https://www.tibiawiki.com.br/images/f/f6/Dream_Matter.gif\" alt=\"Dream Matter.gif\" width=\"32\" height=\"32\" />Sistema de Upgrade (Refinamento), para saber mais visite:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/5/5a/Hammer.gif\" alt=\"Hammer.gif\" width=\"32\" height=\"32\" /></p>\r\n<p style=\"text-align: center;\"><a href=\"../?refinament\"> Refine </a></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f6/Dream_Matter.gif\" alt=\"Dream Matter.gif\" width=\"32\" height=\"32\" /> Sistema de Invas&otilde;es autom&aacute;ticas e aleat&oacute;rias, para saber mais visite:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/thumb/2/22/Tibian_Parchment.gif/56px-Tibian_Parchment.gif\" srcset=\"/images/2/22/Tibian_Parchment.gif 1.5x\" alt=\"Tibian Parchment.gif\" width=\"56\" height=\"56\" /></p>\r\n<p style=\"text-align: center;\"><br /><a href=\"../?bossesraidsaleatorias\">&nbsp;Invas&otilde;es Aleat&oacute;rias </a></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f6/Dream_Matter.gif\" alt=\"Dream Matter.gif\" width=\"32\" height=\"32\" />Ilhas | Bosses, para saber mais visite:</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/ff/Icone8.png\" alt=\"Icone8.png\" width=\"63\" height=\"65\" /></p>\r\n<p style=\"text-align: center;\"><br /><a href=\"../?islands\"> Ilhas &amp; Dolls </a><br /><br />E futuramente o sistema de tier e classifica&ccedil;&atilde;o ser&aacute; adicionado no servidor tamb&eacute;m.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/f/f4/Flames_of_the_Percht_Queen.gif\" alt=\"Flames of the Percht Queen.gif\" width=\"34\" height=\"34\" /> Novas criaturas foram adicionadas&nbsp;<img src=\"https://www.tibiawiki.com.br/images/f/f4/Flames_of_the_Percht_Queen.gif\" alt=\"Flames of the Percht Queen.gif\" width=\"34\" height=\"34\" /></p>\r\n<p style=\"text-align: center;\"><img src=\"https://www.tibiawiki.com.br/images/e/ef/Execowtioner.gif\" alt=\"Execowtioner.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/70/Wardragon.gif\" alt=\"Wardragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/d/d7/Dragolisk.gif\" alt=\"Dragolisk.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/14/Mega_Dragon.gif\" alt=\"Mega Dragon.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/7/79/Souleater.gif\" alt=\"Souleater.gif\" width=\"64\" height=\"64\" /><img src=\"https://www.tibiawiki.com.br/images/1/1c/Moohtant.gif\" alt=\"Moohtant.gif\" width=\"64\" height=\"64\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../template/offlike/imagens/abertura.png\" /></p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Quarta-Feira, as 19:30 ser&aacute; dada a largada!</p>\r\n<p style=\"text-align: center;\">Bom jogo a todos!</p>',1,1756262968,1,11934,11934,1756333519,'0','','images/news/announcement.jpg',0),(6,'Atualizao 0.1','<p data-start=\"188\" data-end=\"218\"><strong data-start=\"191\" data-end=\"216\">&nbsp;</strong></p>\r\n<p><img style=\"text-align: start; cursor: pointer;\" src=\"https://static.tibia.com/images/news/balancingnews_abacuscalculations_250x214.png\" width=\"250\" height=\"214\" align=\"right\" hspace=\"10\" vspace=\"0\" /></p>\r\n<p data-start=\"188\" data-end=\"218\"><strong data-start=\"191\" data-end=\"216\">Stamina &amp; Experi&ecirc;ncia</strong></p>\r\n<ul data-start=\"219\" data-end=\"373\">\r\n<li data-start=\"219\" data-end=\"294\">\r\n<p data-start=\"221\" data-end=\"229\">Antes:</p>\r\n<ul data-start=\"232\" data-end=\"294\">\r\n<li data-start=\"232\" data-end=\"266\">\r\n<p data-start=\"234\" data-end=\"266\">Verde (+39:59h) &rarr;&nbsp;<strong data-start=\"252\" data-end=\"264\">100% EXP</strong></p>\r\n</li>\r\n<li data-start=\"269\" data-end=\"294\">\r\n<p data-start=\"271\" data-end=\"294\">Amarela &rarr;&nbsp;<strong data-start=\"281\" data-end=\"292\">50% EXP</strong></p>\r\n</li>\r\n</ul>\r\n</li>\r\n<li data-start=\"295\" data-end=\"373\">\r\n<p data-start=\"297\" data-end=\"305\">Agora:</p>\r\n<ul data-start=\"308\" data-end=\"373\">\r\n<li data-start=\"308\" data-end=\"344\">\r\n<p data-start=\"310\" data-end=\"344\">Verde (+39:59h) &rarr;&nbsp;<strong data-start=\"328\" data-end=\"340\">130% EXP</strong>&nbsp;</p>\r\n</li>\r\n<li data-start=\"347\" data-end=\"373\">\r\n<p data-start=\"349\" data-end=\"373\">Amarela &rarr;&nbsp;<strong data-start=\"359\" data-end=\"371\">100% EXP</strong></p>\r\n</li>\r\n<li data-start=\"347\" data-end=\"373\"><strong data-start=\"359\" data-end=\"371\">Atacar o \"Treinador\" recupera 1m de stamina a cada 5 minutos.</strong></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<hr data-start=\"375\" data-end=\"378\" />\r\n<p data-start=\"380\" data-end=\"405\"><strong data-start=\"383\" data-end=\"403\">Loot &amp; Drop Rate</strong></p>\r\n<ul data-start=\"406\" data-end=\"484\">\r\n<li data-start=\"406\" data-end=\"444\">\r\n<p data-start=\"408\" data-end=\"444\">Drop rate aumentado de&nbsp;<strong data-start=\"431\" data-end=\"442\">1x  3x</strong></p>\r\n</li>\r\n<li data-start=\"445\" data-end=\"484\">\r\n<p data-start=\"447\" data-end=\"484\">Ajustado devido &agrave; escassez de loot.</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"486\" data-end=\"489\" />\r\n<p data-start=\"491\" data-end=\"525\"><strong data-start=\"494\" data-end=\"523\">Sistema de Teleport (/ir)</strong></p>\r\n<ul data-start=\"526\" data-end=\"655\">\r\n<li data-start=\"526\" data-end=\"578\">\r\n<p data-start=\"528\" data-end=\"578\">O comando&nbsp;<strong data-start=\"538\" data-end=\"545\">/ir</strong>&nbsp;voltou ao estilo&nbsp;<strong data-start=\"563\" data-end=\"575\">cl&aacute;ssico</strong>.</p>\r\n</li>\r\n<li data-start=\"579\" data-end=\"655\">\r\n<p data-start=\"581\" data-end=\"655\">Basta digitar&nbsp;<strong data-start=\"595\" data-end=\"610\">/ir [local]</strong>&nbsp;direto, sem precisar abrir a janela modal.</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"657\" data-end=\"660\" />\r\n<p data-start=\"662\" data-end=\"694\"><strong data-start=\"665\" data-end=\"692\">Reset Task (!resetTask)</strong></p>\r\n<ul data-start=\"695\" data-end=\"764\">\r\n<li data-start=\"695\" data-end=\"729\">\r\n<p data-start=\"697\" data-end=\"729\">Valor antigo:&nbsp;<strong data-start=\"711\" data-end=\"727\">2k por level</strong></p>\r\n</li>\r\n<li data-start=\"730\" data-end=\"764\">\r\n<p data-start=\"732\" data-end=\"764\">Novo valor:&nbsp;<strong data-start=\"744\" data-end=\"760\">1k por level</strong>&nbsp;</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"766\" data-end=\"769\" />\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\" data-start=\"771\" data-end=\"820\">&nbsp;Bom jogo a todos e aproveitem as novidades!</p>',1,1756430042,1,11934,11934,1756430160,'0','','images/news/announcement.jpg',0),(7,'Alteraes & Balanceamentos #01','<p style=\"text-align: center;\" data-start=\"113\" data-end=\"184\"><strong>Altera&ccedil;&otilde;es &amp; Balanceamentos #01</strong></p>\r\n<p>&nbsp;</p>\r\n<ul style=\"list-style-type: square;\" data-start=\"186\" data-end=\"645\">\r\n<li data-start=\"186\" data-end=\"275\">\r\n<p data-start=\"188\" data-end=\"275\">O valor da bless, que antes era de 400 gps por level, passa a ser de 300 gps por level.</p>\r\n<img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/balancingnews_abacuscalculations_250x214.png\" width=\"250\" height=\"214\" align=\"right\" hspace=\"10\" vspace=\"0\" /></li>\r\n<li data-start=\"276\" data-end=\"364\">\r\n<p data-start=\"278\" data-end=\"364\">O custo do reset task, que antes era de 1k de gps por level, passa a ser de 0.5k de gps por level.</p>\r\n</li>\r\n<li data-start=\"276\" data-end=\"364\">Os bosses de reward chest tamb&eacute;m tiveram seus drops corrigidos, visto que bosses de respawn estavam bugados e n&atilde;o dropavam loots.</li>\r\n<li data-start=\"365\" data-end=\"515\">\r\n<p data-start=\"367\" data-end=\"515\">O feiti&ccedil;o <strong><em data-start=\"377\" data-end=\"389\">exori bash</em></strong> agora possui range definido de 5 sqm. Anteriormente era poss&iacute;vel utiliz&aacute;-lo fora da tela, sem necessidade de vis&atilde;o do alvo.</p>\r\n</li>\r\n<li data-start=\"516\" data-end=\"645\">\r\n<p data-start=\"518\" data-end=\"645\">A experi&ecirc;ncia em party e solo foi corrigida. Agora o sistema verifica corretamente os stages de experi&ecirc;ncia e a party shared.</p>\r\n</li>\r\n<li data-start=\"516\" data-end=\"645\">O fator de recupera&ccedil;&atilde;o da stamina foi alterado, agora a cada 2 minutos on-line na protection zone recupera 1 ponto de stamina&nbsp;<strong>caso a stamina esteja abaixo de 40:00 horas,&nbsp;</strong>caso a stamina esteja acima de 40 horas, seu fator de recupera&ccedil;&atilde;o &eacute; de&nbsp;<strong>5 minutos para 1.<br /><br />Em breve o sistema de task ser&aacute; atualizado, as tasks ser&atilde;o padronizadas e classificadas como \"f&aacute;ceis\", \"m&eacute;dias\" e \"dif&iacute;ceis\" padronizando tamb&eacute;m o valor dos resets.<br /><br />- Bom jogo a todos!<br /><br /><br /></strong></li>\r\n</ul>',1,1756534219,1,11934,11934,1756534449,'0','','images/news/announcement.jpg',0),(9,'Alteraes & Balanceamentos #02','<p><strong>O servidor foi reiniciado as 15:40 para as seguintes altera&ccedil;&otilde;es:</strong></p>\r\n<ol>\r\n<li><strong>O sistema de task foi modificado.<br /></strong><br />Agora, as tasks ser&atilde;o resetadas automaticamente ap&oacute;s 24 horas de cooldown, al&eacute;m disso o valor do !resetTask foi alterado novamente para 6x o valor da recompensa.<br /><br /><strong>Ex:&nbsp;</strong>Suponhamos que o jogador fa&ccedil;a 3x a task de minotauros e receba 10k de recompensa por cada task, (fazendo 3x receber&aacute; 30k) al&eacute;m da experi&ecirc;ncia e pontos de task.<br />Se o jogador optar por reseta-l&aacute;, ele ter&aacute; que pagar 60k, ou seja ele estar&aacute; pagando pela experi&ecirc;ncia que vai adquirir.&nbsp;<br /><br />Em contratempo, se o intuito do jogador for farmar dinheiro com a task, ele poder&aacute; fazer 3x a task, aguardar 24 horas e fazer novamente.<br /><img style=\"cursor: pointer;\" src=\"https://static.tibia.com/images/news/news_fixes_243x200.png\" width=\"243\" height=\"200\" align=\"right\" hspace=\"8\" vspace=\"10\" /><br /><br /></li>\r\n<li><strong>Novas tasks foram adicionadas e as tasks existentes sofreram altera&ccedil;&otilde;es.<br /></strong><br />A quantidade de criaturas, recompensa e experi&ecirc;ncia de cada task foi modificada.<br /><br /></li>\r\n<li><strong>A runa Dharmas Caos Rune sofreu uma leve altera&ccedil;&atilde;o.</strong><br /><br />A voca&ccedil;&atilde;o&nbsp;<strong>MS</strong>&nbsp;tem um b&ocirc;nus de dano de 13,5% a mais que&nbsp;<strong>ED&nbsp;</strong>em runas comuns como&nbsp;<strong>DD, FM, HOLY e SD<br /><br /></strong>al&eacute;m disso podem usar a Dharmas que &eacute; uma runa exclusiva de MS.<br /><br />Por&eacute;m, depois de v&aacute;rios testes percebemos que a dharmas estava totalmente desbalanceada, o intuito &eacute; que ela seja mais forte que as runas comuns, por&eacute;m o seu dano estava 126,19% mais forte do que uma runa comum.<br /><br /><strong>Ex:</strong>&nbsp;2 personagens foram criados (ED e MS), ambos com level 140 e 100 de magic level e obtivemos os seguintes resultados.<br /><br />O dano da DD do MS sobre o ED foi de 420 (aproximadamente +13,5%)<br />O dano da DD do ED sobre o MS foi de 370 (aproximadamente - 13,5%)<br /><br />O dano da Dharmas sobre o ED foi de 800 ~ 950 (aproximadamente +126,19% a mais que o dano da DD)<br />Com isso reduzimos o dano da Dharmas para 66,6% a mais do que o dano da DD e outras runas comuns.<br /><br /></li>\r\n<li><strong>O food infinito foi corrigido e agora est&aacute; funcionando 100%.<br /></strong></li>\r\n<li><strong>A royal spear agora passou a ser um item de quest, pode ser obtida em elven (rivendell) na estatua ao lado da bancada de foods.<br /></strong><strong><br /><br /><br /><br />Bom jogo a todos!</strong></li>\r\n</ol>',1,1756580792,1,11934,0,0,'0','','',0);
